f6a6c6b6-e7b5-4d1f-aad5-11220b5e4b71=ReadMe\r\n\=\=\=\=\=\=\=\r\n\r\nHow to configure\r\n----------------------------------------\r\n\r\nDo not modify this module, instead\:\r\n1. Create a new module called 'MxModelReflectionCustomizations'.\r\n2. Add new pages to this module, reuse snippets from the 'MxModelReflection' module. \r\n    The pages in the 'MxModelReflectionModule' can be used as examples.\r\n3. Create new microflows to replace the microflows which open forms. Generic microflows can be reused.
